MoNiques Friday Favs is when I share products from amazing small business. Please like, share, follow and buy from these amazing businesses:

@wicksandcharm candles smell great! I love the tins they come in they are simple and chic!

@the.enlightenculture has apparel and jewelry. Her t-shirts are soft and the earrings are so cute. 
Use code Thanks20 for 20% off your next order 

@simplyelementarystickers stickers are so fun and cute. I absolutely love my personalize cards! You can personalize your own!!!
Use code: MoNique15 for 15% off

@tinytikeslearning has the great products to get kids ready before their first year of school. Her products are available for personalization.
Use code: MONIQUESWORLD15 for 15% off.

Thank you so much

